DROP DATABASE if EXISTS leendo;
create database leendo;
use leendo;

/* Tabela de clientes da mercearia*/
create table cliente(
	CODIGO MEDIUMINT NOT NULL AUTO_INCREMENT,
	NOME varchar(40),
	ENDERECO varchar(40),
	BAIRRO varchar(40),
	CEP varchar(8),
	MUNICIPIO varchar(40),
	UF varchar(2),
	TELEFONE varchar(40),
	EMAIL VARCHAR(60),
    
    primary key (CODIGO),
    INDEX (CODIGO), INDEX (NOME)
);

/* Mercadorias (os produtos vendidos)*/
create table mercadoria(
	CODIGO INT(13) NOT NULL AUTO_INCREMENT,
	DESCRICAO varchar(40),
	NCM VARCHAR(10),
	PRECO_CUSTO decimal(12,2),
	PRECO_VENDA decimal(12,2),
	ESTOQUE decimal(12,2),

   primary key (CODIGO),
   INDEX (CODIGO), INDEX (DESCRICAO)
);

/* Vendas */
CREATE TABLE vendas(
	ID INT(10) NOT NULL AUTO_INCREMENT,
	DATA_VENDA DATE,
	CLIENTE INT(6) NOT NULL,
	PRODUTO INT(13) NOT NULL,
	QUANTIDADE decimal(12,2),
	VALOR decimal(12,2),
	
	primary key (ID),
	INDEX (CLIENTE, DATA_VENDA), INDEX (PRODUTO, DATA_VENDA)
);




